import React, { props } from "react";
import Kartica from "./Kartica";
import "./Prikazivanje.css";

export default function Prikazivanje(props, { setCartNum }) {
  let artikli = props.podaci.data;
  return (
    <div className="grid">
      {artikli.map((artikal, id) => {
        return <Kartica osoba={artikal} setCartNum={setCartNum}></Kartica>;
      })}
    </div>
  );
}
